import React, { useState } from "react";
import styles from "./Home.module.css";
import Content from "../../Components/Content/Content";
import SongCard from "../../Components/SongCard/SongCard";
import songLogo1 from "../../Assets/Images/song_Card_Logo1.jpg";
import songLogo2 from "../../Assets/Images/song_Card_Logo1.jpg";
import songLogo3 from "../../Assets/Images/song_Card_Logo1.jpg";
import songLogo4 from "../../Assets/Images/song_Card_Logo1.jpg";
import songLogo5 from "../../Assets/Images/song_Card_Logo1.jpg";
import songLogo6 from "../../Assets/Images/song_Card_Logo1.jpg";

const Home = () => {
  const [singerData, setSingerData] = useState([
    {
      imageUrl: songLogo1,
      singerName: "current",
    },
    {
      imageUrl: songLogo2,
      singerName: "KR$NA ALL SONG'S",
    },
    {
      imageUrl: songLogo3,
      singerName: "Liked Songs",
    },
    {
      imageUrl: songLogo4,
      singerName: "Call You Right Back,I'm in Therapy",
    },
    {
      imageUrl: songLogo5,
      singerName: "Talha Anjum",
    },
    {
      imageUrl: songLogo6,
      singerName: "SUPERVILLAIN",
    },
  ]);
  return (
    <Content>
      <div className={styles.home}>
        <div className={styles.homeContent}>
          <div className={styles.homeHeader}>
            <div className={styles.headerLeft}>
              <img
                className={styles.lefttArrowIcon}
                src={require("../../Assets/Icons/left_Arrow_Icon.png")}
                alt=""
              />
              <img
                className={styles.rightArrowIcon}
                src={require("../../Assets/Icons/right_Arrow_Icon.png")}
                alt=""
              />
            </div>
            <div className={styles.headerRight}>
              <span className={styles.explore}>Explore Premium</span>
              <span className={styles.Install}>Install App</span>
            </div>
          </div>
          <span className={styles.goodAfternoon}>Good afternoon</span>
          <div className={styles.singerData}>
            {singerData.map((item, index) => (
              <div className={styles.songCard}>
                <SongCard />
              </div>
            ))}
          </div>
        </div>
      </div>
    </Content>
  );
};

export default Home;
